import React from "react";

const Card = (props) => {
  return (
    <>
      <div className="card m-3 " style={{ width: "18rem", maxHeight: "360px" }}>
        <img
          src="https://images.unsplash.com/photo-1606471191009-63994c53433b?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=700&ixid=MnwxfDB8MXxyYW5kb218MHx8bm9udmVnfHx8fHx8MTY5NDA2MjMwNA&ixlib=rb-4.0.3&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=900"
          className="card-img-top"
          alt="loading"
        />
        <div className="card-body">
          <h5 className="card-title">{props.foodName}</h5>
          <div className="container w-100">
            <select className="m-2 h-100  bg-success">
              {Array.from(Array(6), (e, i) => {
                return (
                  <option key={i + 1} value={i + 1}>
                    {i + 1}
                  </option>
                );
              })}
            </select>
            <select className="m-2 h-100  bg-success rounder">
              <option value="half">Half</option>
              <option value="half">Full</option>
            </select>
            <div className="d-inline h-100 fs-5">Total Price</div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
